/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `after_user_sessions_update` AFTER UPDATE ON `user_sessions` FOR EACH ROW BEGIN
    DECLARE last_pauselog_id INT;

    
    SELECT id INTO last_pauselog_id 
    FROM user_pause_logs
    WHERE user_id = NEW.user_id
    AND end_at IS NULL
    ORDER BY id DESC
    LIMIT 1;

    
    IF last_pauselog_id IS NOT NULL THEN
        UPDATE user_pause_logs
        SET end_at = NEW.end_time
        WHERE id = last_pauselog_id;
    END IF;
END */;;
